const items = $input.all().map(i => i.json);

return items.map(item => {
  const payload =
    (item.payload && typeof item.payload === "object" && !Array.isArray(item.payload))
      ? item.payload
      : {};

  const appKey = Object.keys(payload)[0] || null;
  const data = (appKey && Array.isArray(payload[appKey])) ? payload[appKey] : [];

  let status = "ready";
  let validation = { isValid: true, code: null, errors: [] };

  if (!appKey || data.length === 0) {
    status = "no_data";
    validation = {
      isValid: false,
      code: "NO_DATA",
      errors: ["payload vazio ou sem registros"]
    };
  }

  const warning = (status !== "ready")
    ? { code: validation.code, message: "Arquivo sem dados." }
    : null;

  return {
    json: {
      ...item,
      appKey,
      data,
      status,
      validation,
      warning
    }
  };
});

function toArray(v) {
  return Array.isArray(v) ? v : [];
}

const items = $input.all().map(i => i.json).filter(Boolean);

// pega o batchId do primeiro item que tiver
const batchId =
  items.find(x => x && x.batchId)?.batchId
  ?? null;

// groups genérico (serve pra debug / flex)
const groups = items.reduce((acc, w) => {
  const k = w?.kind || "unknown";
  if (!acc[k]) acc[k] = [];
  acc[k].push(w);
  return acc;
}, {});

// baldes explícitos (pra facilitar IFs + Execute Workflow)
const pieItems = toArray(groups.pie);
const tableItems = toArray(groups.table);
const barItems = toArray(groups.bar);
const areaItems = toArray(groups.area);
const bigNumberItems = toArray(groups.big_number);

// opcional: itens desconhecidos
const unknownItems = toArray(groups.unknown);

return [
  {
    json: {
      batchId,
      groups,
      pieItems,
      tableItems,
      barItems,
      areaItems,
      bigNumberItems,
      unknownItems,
      totalItems: items.length
    }
  }
];

